import iconsImgs from "../utils/images/iconsImgs";

export const navigationLinks = [
  { id: 1, title: "Home", image: iconsImgs.home },
  { id: 2, title: "Completed tasks", image: iconsImgs.plane },
  { id: 3, title: "Incomplete tasks", image: iconsImgs.wallet },
];
